import SearchLeft from "./searchLeft";

class Search extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className="search">
                <SearchLeft></SearchLeft>
                <div className="search__left">
                    <h1>Recherche</h1>
                </div>
                <div className="search__right">
                    dzefreugfijdz
                </div>
            </div>
        )
    }
}
export default Search;
